{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/supatroongpraiwan/google-data-analytics-capstone-project?scriptVersionId=99305352\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"573b8726","metadata":{"papermill":{"duration":0.013707,"end_time":"2022-06-25T16:35:32.882591","exception":false,"start_time":"2022-06-25T16:35:32.868884","status":"completed"},"tags":[]},"source":["# How Does a Bike-Share Navigate Speedy Success?\n","### Google Data Analytics Capstone Project"]},{"cell_type":"markdown","id":"7150d252","metadata":{"papermill":{"duration":0.010406,"end_time":"2022-06-25T16:35:32.90335","exception":false,"start_time":"2022-06-25T16:35:32.892944","status":"completed"},"tags":[]},"source":["# Introduction\n","This is my first data analytics project based on a case study given by Google Data Analytics Professional Certificate course. In this project, I will use data analytics thinking process and tools to solve this fictional real-world problem. In this report, I included following deliverables:\n","1. A clear statement of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of analysis\n","5. Supporting visualizations and key findings\n","6. Top three recommendations based on the analysis\n"]},{"cell_type":"markdown","id":"e918fbd6","metadata":{"papermill":{"duration":0.010449,"end_time":"2022-06-25T16:35:32.924578","exception":false,"start_time":"2022-06-25T16:35:32.914129","status":"completed"},"tags":[]},"source":["# Scenario\n","Firstly, lets back you up by the scenario of this project. In this project, I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights,\n","my team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations."]},{"cell_type":"markdown","id":"e8b7ce58","metadata":{"papermill":{"duration":0.010304,"end_time":"2022-06-25T16:35:32.945505","exception":false,"start_time":"2022-06-25T16:35:32.935201","status":"completed"},"tags":[]},"source":["# Business Task\n","From the scenario, lets define our business task (i.e. the goal of this anaysis). We know that the company believes that the income from annual memberships is much better than casual user. Thus, they want to increase the number of annual memberships using our anaysis insights. So we should deliver some insights that describe each types of user behavior and trend. Hence, the question I would ask for this goal is\n","> What are the charateristics of annual members and casual riders?\n","\n","> How to increase the number of annual memberships? \n","\n","> Is there any potential to convert casual user to annual memberships user?"]},{"cell_type":"markdown","id":"9b22276e","metadata":{"papermill":{"duration":0.01023,"end_time":"2022-06-25T16:35:32.966434","exception":false,"start_time":"2022-06-25T16:35:32.956204","status":"completed"},"tags":[]},"source":["# Dataset\n","I will use Cyclistic’s historical trip data to analyze and identify trends from [the previous 12 months of Cyclistic trip data](http://divvy-tripdata.s3.amazonaws.com/index.html). (Note: The datasets have a different name because Cyclistic is a fictional company. The data has been made available by Motivate International Inc. under this [license](http://ride.divvybikes.com/data-license-agreement).) This is public data that can be use to explore how different customer types are using Cyclistic bikes. But note that data-privacy issues is prohibited from using riders’ personally identifiable information. This means that we won’t be able to connect pass purchases to credit card numbers to determine if casual riders live in the\n","Cyclistic service area or if they have purchased multiple single passes.\n","\n","The historical trip data is divided by month, each dataset has 13 columns representing user id, user type, rideable type, start & ending information for timestamp, station name, station id, and station location (latitude & longitude). "]},{"cell_type":"markdown","id":"2da8103d","metadata":{"papermill":{"duration":0.010295,"end_time":"2022-06-25T16:35:32.987192","exception":false,"start_time":"2022-06-25T16:35:32.976897","status":"completed"},"tags":[]},"source":["# Prepare\n","After looked at the dataset, I decided to use the 12 months of historical data from March 2021 to Febuary 2022. I found that the accumulate row of these usage data is over millions, so I decided to use SQL (Google BigQuery) to clean and maniplate initial data. Then, I would use Tableau to represent geological data and R for other visualizations. "]},{"cell_type":"markdown","id":"8e0012a7","metadata":{"papermill":{"duration":0.010161,"end_time":"2022-06-25T16:35:33.007969","exception":false,"start_time":"2022-06-25T16:35:32.997808","status":"completed"},"tags":[]},"source":["# Processing data\n","In this section, I will describe the process and code for cleaning this dataset. Note that these SQL code is the example of what I used to clean data and it is not runnable in this notebook.\n","\n","I started from uploading dataset to Google BigQuery and union each month's data using a code below\n","\n","Note that some month data sizes are bigger than my BigQuery sandbox limitation, so I had to split my data in Excel before import them."]},{"cell_type":"markdown","id":"8cf30368","metadata":{"_kg_hide-input":false,"execution":{"iopub.execute_input":"2022-05-28T17:58:07.951034Z","iopub.status.busy":"2022-05-28T17:58:07.950293Z","iopub.status.idle":"2022-05-28T17:58:16.983668Z","shell.execute_reply":"2022-05-28T17:58:16.982609Z","shell.execute_reply.started":"2022-05-28T17:58:07.950998Z"},"papermill":{"duration":0.010471,"end_time":"2022-06-25T16:35:33.028848","exception":false,"start_time":"2022-06-25T16:35:33.018377","status":"completed"},"tags":[]},"source":["```sql\n","SELECT * FROM `202103-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202104-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202105-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202106-tripdata-1`\n","UNION DISTINCT\n","SELECT * FROM `202106-tripdata-2`\n","UNION DISTINCT\n","SELECT * FROM `202107-tripdata-1`\n","UNION DISTINCT\n","SELECT * FROM `202107-tripdata-2`\n","UNION DISTINCT\n","SELECT * FROM `202108-tripdata-1`\n","UNION DISTINCT\n","SELECT * FROM `202108-tripdata-2`\n","UNION DISTINCT\n","SELECT * FROM `202109-tripdata-1`\n","UNION DISTINCT\n","SELECT * FROM `202109-tripdata-2`\n","UNION DISTINCT\n","SELECT * FROM `202110-tripdata-1`\n","UNION DISTINCT\n","SELECT * FROM `202110-tripdata-2`\n","UNION DISTINCT\n","SELECT * FROM `202111-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202112-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202201-tripdata`\n","UNION DISTINCT\n","SELECT * FROM `202202-tripdata`\n","```"]},{"cell_type":"markdown","id":"52181ab9","metadata":{"papermill":{"duration":0.010167,"end_time":"2022-06-25T16:35:33.049451","exception":false,"start_time":"2022-06-25T16:35:33.039284","status":"completed"},"tags":[]},"source":["I saved this table as `tripdata_year_raw`\n","\n","## Cleaning data\n","\n","From the table the ride id column is the primary key, so I observed its characteristics by `LENGHT` function.\n","\n","I found that most of the ride id has 16 char character length.\n","\n","Therefore, I clean data by remove duplicate using `DISTINCT` function and filter out some invalid ride id by remove null value and id length (limit to only 16) using code below."]},{"cell_type":"markdown","id":"07c758d5","metadata":{"execution":{"iopub.execute_input":"2022-05-29T13:50:07.87576Z","iopub.status.busy":"2022-05-29T13:50:07.873458Z","iopub.status.idle":"2022-05-29T13:50:08.038875Z"},"papermill":{"duration":0.010379,"end_time":"2022-06-25T16:35:33.070021","exception":false,"start_time":"2022-06-25T16:35:33.059642","status":"completed"},"tags":[]},"source":["```sql \n","SELECT DISTINCT *\n","FROM `tripdata_year_raw`\n","WHERE ride_id IS NOT NULL AND LENGTH(ride_id) = 16\n","```"]},{"cell_type":"markdown","id":"ae70cf05","metadata":{"papermill":{"duration":0.01032,"end_time":"2022-06-25T16:35:33.090646","exception":false,"start_time":"2022-06-25T16:35:33.080326","status":"completed"},"tags":[]},"source":["Then, save this table as `tripdata_year_no_duplicate`"]},{"cell_type":"markdown","id":"0b87ac7c","metadata":{"papermill":{"duration":0.01019,"end_time":"2022-06-25T16:35:33.111055","exception":false,"start_time":"2022-06-25T16:35:33.100865","status":"completed"},"tags":[]},"source":["## Manipulating data\n","### Data for R"]},{"cell_type":"markdown","id":"7d79a6b4","metadata":{"papermill":{"duration":0.010005,"end_time":"2022-06-25T16:35:33.132068","exception":false,"start_time":"2022-06-25T16:35:33.122063","status":"completed"},"tags":[]},"source":["From the `tripdata_year_no_duplicate`, I want to extract data for analysis including \n","* ride id (primary key)\n","* member type\n","* rideable type\n","* started timestamp\n","* ended timestamp\n","* year and month*\n","* day of week*\n","* time of the day*\n","* ride length* (time period)\n","* started station name\n","* ended station\n","\n","Some of the information can be copied immediately from the previous table, however, information that have `*` mask have to obtain by manipulating some information from the original table.\n","\n","Firstly, for year and month column, I used the original information from started timestamp column by using `EXTRACT` function to extract year and month from timestamp information. Then I use `CAST` function to cast the information to `STRING` type and then join them with `CONCAT` function.\n","\n","Then, use `CASE` function to extract day of week and time of day information from the starting time column.\n","\n","After that, calculate ride period using the ending time subtract by starting time.\n","\n","In the end, avoid any invalid ride period value by filter only positive values.\n","\n","The above process can be done using a code below"]},{"cell_type":"markdown","id":"8be8f7ed","metadata":{"execution":{"iopub.execute_input":"2022-05-28T17:41:26.290907Z","iopub.status.busy":"2022-05-28T17:41:26.288693Z","iopub.status.idle":"2022-05-28T17:41:26.325107Z"},"papermill":{"duration":0.010328,"end_time":"2022-06-25T16:35:33.152797","exception":false,"start_time":"2022-06-25T16:35:33.142469","status":"completed"},"tags":[]},"source":["```sql\n","WITH decided_column AS\n","(\n","  SELECT \n","      ride_id,\n","      rideable_type,\n","      member_casual,\n","      started_at,\n","      ended_at,\n","      CONCAT(CAST(EXTRACT(YEAR FROM started_at) AS STRING), \"-\", CAST(EXTRACT(MONTH FROM started_at) AS STRING)) AS year_month,\n","      CASE\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 1 THEN \"Sunday\"\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 2 THEN \"Monday\"\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 3 THEN \"Tuesday\"\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 4 THEN \"Wednesday\"\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 5 THEN \"Thursday\"\n","          WHEN EXTRACT(DAYOFWEEK FROM started_at) = 6 THEN \"Friday\"\n","          ELSE \"Saturday\"\n","      END AS day_of_week,\n","      CASE\n","          WHEN EXTRACT(HOUR FROM started_at) >= 6 AND EXTRACT(HOUR FROM started_at) < 11 THEN \"morning\"\n","          WHEN EXTRACT(HOUR FROM started_at) >= 11 AND EXTRACT(HOUR FROM started_at) < 16 THEN \"afternoon\"\n","          WHEN EXTRACT(HOUR FROM started_at) >= 16 AND EXTRACT(HOUR FROM started_at) < 21 THEN \"evening\"\n","          ELSE \"night\"\n","      END AS time_of_day,\n","      ended_at - started_at AS ride_length,\n","      start_station_name,\n","      end_station_name\n","  FROM `tripdata_year_no_duplicate` \n",")\n","SELECT *\n","FROM decided_column\n","WHERE \n","    ride_length > MAKE_INTERVAL(0, 0, 0, 0, 0, 0) \n","    AND ride_length IS NOT NULL\n","```"]},{"cell_type":"markdown","id":"81ad4254","metadata":{"papermill":{"duration":0.010423,"end_time":"2022-06-25T16:35:33.173657","exception":false,"start_time":"2022-06-25T16:35:33.163234","status":"completed"},"tags":[]},"source":["I saved this result to `tripdata_year_cleaned`, which will be import later for analysis in R environment."]},{"cell_type":"markdown","id":"289cc214","metadata":{"papermill":{"duration":0.010341,"end_time":"2022-06-25T16:35:33.19403","exception":false,"start_time":"2022-06-25T16:35:33.183689","status":"completed"},"tags":[]},"source":["### Data for Tableau\n"]},{"cell_type":"markdown","id":"ee9e671e","metadata":{"papermill":{"duration":0.011254,"end_time":"2022-06-25T16:35:33.215444","exception":false,"start_time":"2022-06-25T16:35:33.20419","status":"completed"},"tags":[]},"source":["Based on `tripdata_year_cleaned` table, I want to extract data for creating traffic dash board in Tableau. \n","\n","Since there is no latitude and longitude information for each station, I decided to determine latitude and longitude value by their average value first.\n","\n","This can be done by retrieve all station name, with their latitude and longitude from `tripdata_year_no_duplicate` table in started station and ended station column then `UNION` them together and store it in temporary table called `location`. After that, `GROUP BY` the station name and average their latitude and longitude values.    \n","\n","The above process can be explain using the code below"]},{"cell_type":"markdown","id":"9c80b108","metadata":{"papermill":{"duration":0.010359,"end_time":"2022-06-25T16:35:33.236154","exception":false,"start_time":"2022-06-25T16:35:33.225795","status":"completed"},"tags":[]},"source":["```sql\n","WITH location AS\n","(\n","  SELECT\n","    start_station_name AS station_name,\n","    start_lat AS lat,\n","    start_lng AS lng\n","  FROM `tripdata_year_no_duplicate`\n","  WHERE \n","    start_station_name IS NOT NULL \n","    AND start_lat IS NOT NULL \n","    AND start_lng IS NOT NULL\n","\n","  UNION ALL\n","\n","  SELECT\n","    end_station_name AS station_name,\n","    end_lat AS lat,\n","    end_lng AS lng\n","  FROM `tripdata_year_no_duplicate`\n","  WHERE \n","    end_station_name IS NOT NULL \n","    AND end_lat IS NOT NULL \n","    AND end_lng IS NOT NULL\n",")\n","SELECT\n","  station_name,\n","  AVG(lat) AS latitude,\n","  AVG(lng) AS longitude\n","FROM location\n","GROUP BY station_name\n","```"]},{"cell_type":"markdown","id":"88964d9d","metadata":{"papermill":{"duration":0.010306,"end_time":"2022-06-25T16:35:33.257172","exception":false,"start_time":"2022-06-25T16:35:33.246866","status":"completed"},"tags":[]},"source":["I saved this location information as `station_location` table.\n","\n","After that, I join them with the `tripdata_year_cleaned` table with selected column are\n","* ride id\n","* rideable type\n","* member type\n","* year and month\n","* day of week\n","* time of the day\n","* ride length\n","* start station name\n","* start station latitude\n","* start station longitude\n","* end station name\n","* end station latitude\n","* end station longitude\n","\n","by using code below"]},{"cell_type":"markdown","id":"3137ed84","metadata":{"papermill":{"duration":0.010269,"end_time":"2022-06-25T16:35:33.277944","exception":false,"start_time":"2022-06-25T16:35:33.267675","status":"completed"},"tags":[]},"source":["```sql\n","SELECT \n","  tripdata.ride_id,\n","  tripdata.rideable_type,\n","  tripdata.member_casual,\n","  tripdata.year_month,\n","  tripdata.day_of_week,\n","  tripdata.time_of_day,\n","  tripdata.ride_length,\n","  tripdata.start_station_name,\n","  start_loc.latitude AS start_latitude,\n","  start_loc.longitude AS start_longitude,\n","  tripdata.end_station_name,\n","  end_loc.latitude AS end_latitude,\n","  end_loc.longitude AS end_longitude\n","FROM `cyclistic_final.tripdata_year_cleaned` AS tripdata\n","INNER JOIN `cyclistic_final.station_location` AS start_loc\n","ON tripdata.start_station_name = start_loc.station_name\n","INNER JOIN `cyclistic_final.station_location` AS end_loc\n","ON tripdata.end_station_name = end_loc.station_name\n","```"]},{"cell_type":"markdown","id":"4e5faaad","metadata":{"papermill":{"duration":0.010313,"end_time":"2022-06-25T16:35:33.298633","exception":false,"start_time":"2022-06-25T16:35:33.28832","status":"completed"},"tags":[]},"source":["I saved this table as `tripdata_year_tableau`, then I exported it to create traffic dashboard using Tableau."]},{"cell_type":"markdown","id":"467e076b","metadata":{"papermill":{"duration":0.010304,"end_time":"2022-06-25T16:35:33.318846","exception":false,"start_time":"2022-06-25T16:35:33.308542","status":"completed"},"tags":[]},"source":["# Analyze\n","I used 2 different tools to analyze data in this project, R for tabular and chart visualizations, and Tableau for geological representation."]},{"cell_type":"markdown","id":"3ac5fe41","metadata":{"papermill":{"duration":0.01028,"end_time":"2022-06-25T16:35:33.339629","exception":false,"start_time":"2022-06-25T16:35:33.329349","status":"completed"},"tags":[]},"source":["## R\n","I start loading data into R environment using code below"]},{"cell_type":"code","execution_count":1,"id":"490c878c","metadata":{"execution":{"iopub.execute_input":"2022-06-25T16:35:33.363914Z","iopub.status.busy":"2022-06-25T16:35:33.361952Z","iopub.status.idle":"2022-06-25T16:35:34.802667Z","shell.execute_reply":"2022-06-25T16:35: